On Wednesday I had a very insightful, touching, and wholesome session with my therapist. We were mid conversation discussing the next chapter for my life when he stopped me with excitement.

"There it is. THAT, is what I strive and search for, every session." "I see it come and go in waves every week."

I was confused and asked what he meant. 

He went on to explain how he was seeing me be congruent with myself. My passion with what I was talking about, my eyes lighting up, my unwavering eye contact, was showing who I really was and what I really wanted for myself. I was being my authentic self. 

He went on to discuss how important being congruent and aligned is, because it means im being honest with myself, and allowing how I feel to honestly reflect in my behaviors. 

"That's powerful" "Once you're fully aligned with yourself, it's going to be dangerous, and you're going to do amazing things."

We went on to discuss this further, but I prefer to keep that to myself because it was individualized to, and very special for, me. However, those words, that conversation, helped me realize how GOOD I feel when I am aligned and congeuent with myself.

Because he was right, when our emotions, thoughts, feelings, and behaviors align, it is so powerful. Its dangerous - in a good way, because you allow yourself to be REAL - to assert yourself, to speak with passion, to speak your full truth, and to act accordingly. 

An aligned and congruent person, is a powerful one. Because they are their authentic self - and whether its when you feel it in yourself, or have someone point it out when they see your eyes light up with passion and truth, embrace it. 

That is your power
That is your potential
That is your passion
That is YOU
Grab it, and run with it as your guide

